import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Profile() {
    const navigate = useNavigate();
    const [savedArticles, setSavedArticles] = useState([]);
    let [userData, setUserData] = useState(null);
    const [preferences, setPreferences] = useState([]); // State for user preferences

    useEffect(() => {
        const callProfilePage = async () => {
            try {
                const response = await fetch('/profile', {
                    method: "GET",
                    headers: {
                        Accept: "application/json",
                        "Content-type": "applications/json"
                    },
                    credentials: "include"
                });

                const data = await response.json();
                setUserData(data);

                if (response.status !== 200) {
                    const err = new Error("Didn't get response");
                    throw err;
                }
            } catch (error) {
                console.log(error);
                navigate('/login')
            }
        };

        const fetchSavedArticles = async () => {
            try {
                const response = await fetch('/saved-articles', {
                    method: 'GET',
                    headers: {
                        Accept: "application/json",
                        "Content-Type": "application/json"
                    },
                    credentials: 'include'
                });

                const articles = await response.json();
                setSavedArticles(articles); // Store saved articles
            } catch (error) {
                console.error("Error fetching saved articles:", error);
            }
        };

        callProfilePage();
        fetchSavedArticles();
    }, [navigate]);

    const handleSavePreferences = async () => {
        try {
            const response = await fetch('/update-preferences', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ preferences })
            });

            const data = await response.json();
            alert(data.message); // Show message after saving preferences
        } catch (error) {
            console.error("Error saving preferences:", error);
        }
    };

    const handlePreferenceChange = (e) => {
        const { value, checked } = e.target;
        if (checked) {
            setPreferences([...preferences, value]);
        } else {
            setPreferences(preferences.filter((pref) => pref !== value));
        }
    };

    return (
        <section className="profile-section container py-5">
            <div className="profile-details row justify-content-center">
                <div className="col-lg-4">
                    <div className="card mb-4">
                        <div className="card-body text-center">
                            <img
                                src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSgKQAcCkbDxBN-U9wTuIQQcP30FUkWvOrFGg&s"
                                alt="avatar"
                                className="rounded-circle img-fluid"
                            />
                            <h5 className="my-3">{userData && userData.firstName} {userData && userData.lastName}</h5>
                            <div>
                                <p><strong>Email:</strong> {userData && userData.email}</p>
                                <p><strong>Phone:</strong> {userData && userData.phone}</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            {/* User Preferences Section */}
            <div className="preferences-section">
                <h4 className="text-center">Select Your Preferences</h4>
                <div className="form-check">
                    <input
                        className="form-check-input"
                        type="checkbox"
                        value="Technology"
                        id="techPref"
                        checked={preferences.includes('Technology')}
                        onChange={handlePreferenceChange}
                    />
                    <label className="form-check-label" htmlFor="techPref">
                        Technology
                    </label>
                </div>
                <div className="form-check">
                    <input
                        className="form-check-input"
                        type="checkbox"
                        value="AI"
                        id="aiPref"
                        checked={preferences.includes('AI')}
                        onChange={handlePreferenceChange}
                    />
                    <label className="form-check-label" htmlFor="aiPref">
                        AI
                    </label>
                </div>
                <button className="btn btn-primary mt-3" onClick={handleSavePreferences}>Save Preferences</button>
            </div>

            {/* Saved Articles Section */}
            <div className="saved-articles-section">
                <h4 className="text-center">Saved Articles</h4>
                <div className="row justify-content-center">
                    {savedArticles.length > 0 ? (
                        savedArticles.map((article, index) => (
                            <div key={index} className="col-md-4">
                                <div className="card mb-4">
                                    <img src={article.urlToImage} className="card-img-top" alt={article.title} />
                                    <div className="card-body">
                                        <h5 className="card-title">{article.title}</h5>
                                        <p className="card-text">{article.description}</p>
                                        <a href={article.url} target="_blank" rel="noopener noreferrer" className="btn btn-primary">Read More</a>
                                        <button className="btn btn-danger mt-2" onClick={() => handleRemoveArticle(article.url)}>Remove</button>
                                    </div>
                                </div>
                            </div>
                        ))
                    ) : (
                        <p className="text-center">No saved articles yet.</p>
                    )}
                </div>
            </div>
        </section>
    );
}

export default Profile;
